import React from "react";
class NavBar extends React.Component {
  array = [
    {
      type: "Stays",
      icon: "fa-bed",
      active: true,
    },
    {
      type: "Flights",
      icon: "fa-plane",
      active: false,
    },
    {
      type: "Car rentals",
      icon: "fa-car",
      active: false,
    },
    {
      type: "Attractions",
      icon: "fa-bed",
      active: false,
    },
    {
      type: "Airport taxis",
      icon: "fa-taxi",
      active: false,
    },
  ];
  state = { type: this.type, icon: this.icon, active: this.active };
  render() {
    return (
      <>
        <div key={props.index}>
          <div>{this.state.type}</div>
          <></>
          <span>{this.state.icon}</span>
        </div>
      </>
    );
  }
}

export default NavBar;
